package OPPS;
import java.util.*; 

public class Swapping {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x, y, t;
		
	 Scanner sc = new Scanner(System.in);
	 x = sc.nextInt();
	 y = sc.nextInt();
	 
	 System.out.println("Before Swappin"+ x + "and"+y);
	   t= x;
	   x=y;
	   y=t;
	   System.out.println("After Swap"+ x + "and"+ y);
	   
	 
	 
				

	}

}
